#include "Tower.h"

#include "MakeAndPlay.h"

#include "UtilityClass.h"

towerclass::towerclass()
{
	minitowermode = false;
	//We init the lookup table:
	for (int i = 0; i < 700; i++)
	{
		vmult.push_back(int(i * 40));
	}
	//We create a blank map
	for (int j = 0; j < 700; j++)
	{
		for (int i = 0; i < 40; i++)
		{
			contents.push_back(0);
		}
	}
	for (int j = 0; j < 120; j++)
	{
		for (int i = 0; i < 40; i++)
		{
			back.push_back(0);
			minitower.push_back(0);
		}
	}

	loadbackground();
	loadmap();
}

int towerclass::backat(int xp, int yp, int yoff)
{
	yp = yp * 8;
	yp += yoff;
	yoff = yp % 8;
	yp = (yp - yoff) / 8;

	if (xp >= 0 && xp < 40)
	{
		while (yp < 0) yp += 120;
		while (yp >= 120) yp -= 120;
		return back[xp + vmult[yp]];
	}
	return 0;
}

int towerclass::at(int xp, int yp, int yoff)
{
	if (minitowermode)
	{
		return miniat(xp, yp, yoff);
	}
	else
	{
		yp = yp * 8;
		yp += yoff;
		yoff = yp % 8;
		yp = (yp - yoff) / 8;

		while (yp < 0) yp += 700;
		while (yp >= 700) yp -= 700;
		if (xp >= 0 && xp < 40)
		{
			return contents[xp + vmult[yp]];
		}
		else if (xp == -1)
		{
			return contents[vmult[yp]];
		}
		else if (xp == 40)
		{
			return contents[39 + vmult[yp]];
		}
		return 0;
	}
}

int towerclass::miniat(int xp, int yp, int yoff)
{
	yp = yp * 8;
	yp += yoff;
	yoff = yp % 8;
	yp = (yp - yoff) / 8;

	while (yp < 0) yp += 100;
	while (yp >= 100) yp -= 100;
	if (xp >= 0 && xp < 40)
	{
		return minitower[xp + vmult[yp]];
	}
	else if (xp == -1)
	{
		return minitower[vmult[yp]];
	}
	else if (xp == 40)
	{
		return minitower[39 + vmult[yp]];
	}
	return 0;
}

void towerclass::fillbackground(std::vector<std::string>& tmap)
{
	for (int j = 0; j < 120; j++)
	{
		std::vector<std::string> maprow = split(tmap[j], ',');
		for (int i = 0; i < 40; i++)
		{
			back[i + vmult[j]] = atoi(maprow[i].c_str());
		}
	}
}

void towerclass::fillminitower(std::vector<std::string>& tmap)
{


	for (int j = 0; j < 100; j++)
	{
		std::vector<std::string> maprow = split(tmap[j], ',');
		for (int i = 0; i < 40; i++)
		{
			minitower[i + vmult[j]] = atoi(maprow[i].c_str());
		}
	}
}

