void towerclass::fillcontents(std::vector<std::string>& tmap)
{
	for (int j = 0; j < 700; j++)
	{
		std::vector<std::string> maprow = split(tmap[j], ',');
		for (int i = 0; i < 40; i++)
		{
			contents[i + vmult[j]] = atoi(maprow[i].c_str());
		}
	}
}

